                  Get Quote
                </NavLink>
                <NavLink to="/roadmap"className="btn btn-outline-light me-4 rounded-pill px-4 py-2">
                  Roadmap
                </NavLink>
              </div>
            </div>
          </div>
        </div>
      </section>
      <About/>
      <Features/>
      <Contact/>
      
    </div>
  );
};

export default Home;
